import React from 'react';
import Header from '../Header/Header';

const Profile: React.FC = () => {
    return (
      <div>
      <Header/>
      <div>
      <div className='hello'>
            <div id='hello'>Добрий день, юзер! Що будемо робити сьогодні?</div>
        </div>
      </div>
      </div>
    );
  };

export default Profile;
